    false,nt"url": null,nt"notes": "Data from Coral Reef Ecosystem Division
    (CRED), NOAA Pacific Islands Fisheries Science Center (PIFSC) Wave and Tide Recorders
    (WTR) provide a time series of temperature, wave and tide data at coral reef sites.
    Data is typically collected for a duration of 2 years using a SBE26 or SBE26plus
    SEAGAUGE Wave and Tide Recorder (Sea-Bird Electronics, Inc., www.seabird.com). Sensors
    include: Real-time clock, thermistor, and Digiquartz temperature-compensated pressure
    sensor. When a WTR is recovered, a new one is typically deployed in the same place.
    Time series data combining multiple deployments from a given site may also be available.
    Please contact CRED with any questions. For program information see the web site
    https://www.pifsc.noaa.gov/cred/ocean_and_climate_change.php",nt"license_title":
